import ListGroup from "react-bootstrap/ListGroup";
import {
  faEnvelopeSquare,
  faHandHoldingHeart,
  faPhone,
} from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const MisList = ({ mis, solInsts }) => {
  return (
    <>
      <ListGroup as="ul">
        {mis.length === 0
          ? "No"
          : mis.map((mis) => (
              <ListGroup.Item as="li" key={mis.id}>
                <h4>{mis.name}</h4>
                {solInsts.map((inst) =>
                  inst.id === mis.solInstId ? (
                    <h4>
                      <FontAwesomeIcon
                        icon={faHandHoldingHeart}
                        size="md"
                        style={{ color: "gray" }}
                      />
                      {"       " + inst.name}
                    </h4>
                  ) : (
                    ""
                  )
                )}
                <h5>
                  <FontAwesomeIcon
                    icon={faEnvelopeSquare}
                    size="lg"
                    style={{ color: "gray" }}
                  />
                  {mis.email}
                </h5>
                <h5>
                  <FontAwesomeIcon
                    icon={faPhone}
                    size="md"
                    style={{ color: "gray" }}
                  />
                  {mis.contact}
                </h5>
              </ListGroup.Item>
            ))}
      </ListGroup>
    </>
  );
};

export default MisList;
